(
  function() {
    'use strict';

    //使用者參數初始化
    if( GM_getValue("最大欄數") === undefined ) {
        GM_setValue("最大欄數", -1);
        GM_setValue("縱向排列", false);
        GM_setValue("顯示卡片背景圖", true);
        GM_setValue("卡片稀有度(水晶顏色)", true);
        GM_setValue("滑鼠移到卡片上時顯示大圖", true);
    }

    var hostname = window.location.hostname;
    if( hostname == "forum.gamer.com.tw") { //巴哈姆特 電腦版
        process("c-article__content");
    }
    else if( hostname == "m.gamer.com.tw" ) { //巴哈姆特 行動版
        process("cbox_txt");
    }
    else if( hostname == "www.facebook.com" ) { //臉書 電腦版
        var counter = 0;
        const CheckerInterval = setInterval(() => {
            if(counter++ <= 10 && document.getElementsByClassName("userContent").length == 0)
				return;
            clearInterval(CheckerInterval);
            process("userContent");
        }, 250) // poll every 0.25s
    }
})();

function process(className) {
    var t0 = performance.now(), count = 0;
    var arr = document.getElementsByClassName(className);
    if(arr[0] === undefined)
        return;
    var maxCols,cols = (arr[0].scrollWidth/227)>>0; //欄數 = 元素寬度/(卡片寬度+1px)
    if( (maxCols = GM_getValue("最大欄數", -1)) > 0)
        cols = cols<=maxCols ? cols : maxCols;
    var query = queryDB(); //function closure, 使外層變數持續存在
    for(var i=0; i<arr.length; i++)
        count += walk(arr[i], cols, query);

    var t1 = performance.now();
    if(count != 0)
        console.log("偵測 "+ count + " 套牌組，共花費 " + (t1-t0).toFixed(2) + " 毫秒，平均 " + ((t1-t0)/count).toFixed(3) + " 毫秒");
    else
        console.log("沒有偵測到牌組，共花費 " + (t1-t0).toFixed(3) + " 毫秒")
}


function walk(content, cols, query) {
    var n, add, walk, count=0;
    var arr = [];
    walk = document.createTreeWalker(content, NodeFilter.SHOW_TEXT, null, false);

    while(n = walk.nextNode()) {
        var result, regex = /(AAEBA|AAECA)[A-Za-z0-9+/=]*/;
        if ((result = regex.exec(n.nodeValue)) !== null) {
            try {
                var obj = decode(result[0]);
                var data = query(obj);
                ++count; //成功解碼代碼

                add = document.createElement('div');
                add.appendChild(document.createTextNode(n.nodeValue.substring(0,result.index))); //保留代碼前面的文字
                add.appendChild(createContent(data, result[0], cols));
                add.appendChild(document.createTextNode(n.nodeValue.substring(result.index+result[0].length))); //保留代碼後面的文字

                while(n.parentNode.tagName == "FONT")  //font包住details會造成格式衝突
					n = n.parentNode;                  //從font以上的父節點取代
                arr.push({old:n, new:add}); 
            }
            catch(err) {
				console.log(result[0]);   //出錯的代碼
                console.log(err.message); //錯誤訊息
            }
        }
    }
    for(let i=0; i<arr.length; i++) {
        arr[i].old.parentNode.replaceChild(arr[i].new,arr[i].old);
        //掛載'複製'按鈕的點擊事件
        var btns = arr[i].new.getElementsByTagName('button');
            btns[0].addEventListener("click", function (e) {
            GM_setClipboard(this.parentNode.parentNode.firstChild.innerText);
        });

    }
    //去除後面多餘的<br>
    for(let i=0; i<arr.length; i++) {
        n = arr[i].new.nextSibling;
        if(n!=undefined && n.tagName=='BR')
            n.parentNode.removeChild(n);
    }
    return count;
}

function cardHTML(card) {
    //卡片card
    var content = "";
    content += `<span class="card"`;
    if(GM_getValue("顯示卡片背景圖", true)) {
        content += ` style="background-image:` +
                   `linear-gradient(to left, rgba(0,0,0,0) 30%, rgba(0,0,0,1.0) 80%),` +
                   `url('https://art.hearthstonejson.com/v1/tiles/` + card.id + `.jpg');"`
    }
    content += `>`;

    //寶石gem
    if(GM_getValue("卡片稀有度(水晶顏色)", true)) {
        switch(card.rarity) {
            case 0:content += '<span class="gem" style="background: black;">'; break; //INVALID
            case 1:content += '<span class="gem" style="background: #757575;">'; break;//COMMON
            case 2:content += '<span class="gem" style="background: #555555;">'; break;//FREE
            case 3:content += '<span class="gem" style="background: #315376;">'; break;//RARE
            case 4:content += '<span class="gem" style="background: #8a2c79;">'; break;//EPIC
            case 5:content += '<span class="gem" style="background: #904000;">'; break;//LEGENDARY
            default:content += '<span class="gem">'; break;
        }
    } else {
        content += '<span class="gem">';
    }
    content += card.cost + '</span>';

    //卡片名稱name
    content += '<span class="name">' + card.name + '</span>';

    //卡片數量count
    if( card.num>1 || card.rarity==5 ) {
        content += '<span class="count">' + (card.rarity==5 ? '★':card.num) + '</span>';
    }

    //卡片提示圖tooltip
    if(GM_getValue("滑鼠移到卡片上時顯示大圖",true)) {
        content += `<span class="tooltip" style="background-image:` +
                   `url('https://art.hearthstonejson.com/v1/render/latest/zhTW/256x/` + card.id + `.png');"></span>`;
    }
    content += '</span>';
    return content;
}


function createContent(data, code, cols) {
    var count=[0,0,0,0,0,0,0];
	var cardsHTML="", cards = data.cards;

    if(GM_getValue("縱向排列",false)) {
        //綜向排列
        var rows = Math.ceil(cards.length/cols);
        for (let i = 0; i < cards.length; i++) {
            if((i)%rows==0)
                cardsHTML += '<span class="col">';
            cardsHTML += cardHTML(cards[i]);
            count[cards[i].rarity] += cards[i].num;
            if((i+1)%rows==0)
                cardsHTML += '</span>';
        }
    }
    else {
        //橫向排列
        cardsHTML += '<span class="col" style="width:' + cols*227 + 'px">'; //設定寬度 = (卡片寬+1px)*欄數
        for (let i = 0; i < cards.length; i++) {
            cardsHTML += cardHTML(cards[i]);
            count[cards[i].rarity] += cards[i].num;
        }
        cardsHTML += '</span>';
    }

    //牌組標題
    var title = document.createElement('span');
    title.className = "title";
    var dust = count[1]*40 + count[3]*100 + count[4]*400 + count[5]*1600; //塵量計算
    title.innerText = dust + "塵 ("+count[1]+"普通 "+count[3]+"精良 "+count[4]+"史詩 "+count[5]+"傳說) ";

    //複製按鈕
	var copyBtn = document.createElement('button');
    copyBtn.innerText = "複製";
    title.appendChild(copyBtn);

    var folder = document.createElement('details');
    folder.className = "hs";
	folder.innerHTML += '<summary>' + code + '</summary>';
    folder.appendChild(title);
    folder.innerHTML += "<div class='decklist'>" + cardsHTML + "</div>";
    folder.innerHTML += '<div style="clear:both"></div>'; //清除浮動

    return folder;
}

//將base64的varint轉成數字陣列
function readVarLen(str) {
	var buf = atob(str);
	var arr = [], len = buf.length, counter = 0, shift, b, res;

	while (counter < len) {
		shift = 0;
		res = 0;
		do {
			if (counter >= len ) {
				throw new RangeError('無法解碼varint');
			}
			b = buf.charCodeAt(counter++);
			res |= (b & 0x7F) << shift;
			shift += 7;
		} while (b >= 0x80);
		arr.push(res);
	}
	return arr;
}

//將牌組代碼解碼為dbfID
function decode(deckstring) {
	var arr = readVarLen(deckstring);
    var idx = 3;

    var format = arr[2];
    var heroes = new Array(arr[idx++]);
    for (let i = 0; i < heroes.length; i++) {
        heroes[i] = arr[idx++];
    }
    var cards = [];
    for (let i = 1; i <= 3; i++) {
        for (var j = 0, c = arr[idx++]; j < c; j++) {
            cards.push([
                arr[idx++],
                i === 1 || i === 2 ? i : arr[idx++],
            ]);
        }
    }
    return {
        format: format,
        heroes: heroes,
        cards: cards,
    };
}

