		//	throw new RangeError('未知的英雄:' + obj.heroes[0]);

        var cards = [];

        for( var i=0; i<obj.cards.length; i++ ) {
            var entry = hearthstoneDB[obj.cards[i][0]];
			if( entry === undefined )
				throw new RangeError('未知的卡片dbfid:' + obj.cards[i][0].toString());
            var cardInfo = {
                "name": entry[0],
                "id": entry[1],
                "cost": entry[2],
                "rarity": entry[3],
                "num": obj.cards[i][1],
                "dbfid": obj.cards[i][0]
            };
            cards.push(cardInfo);
        }
        cards.sort(function (a, b) {return a.cost==b.cost ? (a.rarity-b.rarity):(a.cost-b.cost);});

        return {
            format: format,
            hero: hero,
            cards: cards,
        };
